    return(
        <div>
            <h4>{name}</h4>
            <p>
                <span>Orçamento: </span>R${budget}
            </p>
            <p>
                <span>•</span> {name}
            </p>
            <div>
                <p>Editar</p>
                <p>Remover</p>
            </div>
        </div>
    )
}

